import React, { useState, useEffect } from "react";
import Axios from "axios";
import {
  Nav,
  Navbar,
  NavDropdown,
  NavItem,
  Card,
  Button,
} from "react-bootstrap";
import classNames from "classnames";
import *  as api from  "../components/Housing" 
function CommonFilterOrg() {
  return (
    <div className="org_filter">
    <main>
      <Button
        className="fullWidth"
        variant="primary"
        onClick={() => setButtonPoup(true)}
      >
        Filter Organizations
      </Button>
    </main>

    <Popup trigger={buttonPoup} setTrigger={setButtonPoup}>
      <span>Filter by: </span>
      <br></br>
      <Checkbox
        label="Photo ID"
        value={checked}
        onChange={handleChangePoupFilterByPhotoID}
      />
    </Popup>
  </div>
  );
}

export default CommonFilterOrg;
